window.bookSummaryJSON = "<p>In the highly anticipated follow-up to Will and Timantha's story, Will decides to take the ultimate plunge—proposing to the love of his life. But for a man like Will who's obsessed with his bride, simple nuptials won’t do. Instead, he’s planning the destination wedding of the year, kicking off with a wild co-ed bachelor/bachelorette party thirty thousand feet in the air.</p> <p>Set against the breathtaking backdrop of a private Greek island, <i>My Filthy Rich Valentine</i> unfolds through multiple points of view, offering a peek into the lives and hearts of Timantha, Autika, and Anastasia—three fiercely independent women navigating love, friendship, and their own personal crossroads. Along the way, you’ll meet Will’s filthy rich and irresistibly charming friends, who add their own blend of chaos to the mix.</p> <p>From over-the-top antics to heartfelt confessions, <i>My Filthy Rich Valentine</i> is a rollercoaster of emotions that will have you laughing, swooning, and rooting for love in all its messy, glorious forms.</p>"; 
